import React, { Component } from 'react';

class Options extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { books } = this.props;

    return (
      <option>
        {books.title} &mdash; {books.author}
      </option>
    )
  }
}
export default Options;
